import { Routes} from 'react-router-dom';
import Home from './all/components/Home';
//import Splash from './all/component/Splash';
import {Route} from 'react-router-dom';
import Registration from './all/components/Registration';
import Login from './all/components/Login';
import { Component } from 'react';
//import Splash from './all/components/splash';
class App extends Component {
  render(){
  return(
    <>
     <Routes>
     <Route exact path='/registration' component={Registration} />
     <Route exact path='/home' component={Home} />
     <Route exact path='/login' component={Login} />
   </Routes>
   <Registration/>
  </>

  )
  }
};
export default App;
